import React from "react";
import ReactDOM from "react-dom";
import "./App.css";

function Header() {
  return (
    <header>
      <h1>MyFridge</h1>
    </header>
  );
}

function App() {
  return (
    <div className="App">
      <Header />

      <h1>Main</h1>
      <h1>Footer</h1>
    </div>
  );
}

export default App;
